import React from 'react'
import axios from 'axios'


class CompanyGraph extends React.Component{
    constructor(){
        super()
        this.state = {
          partners:this.props.currentCompany
        }
      }
    render(){
        return(
            <div>{this.state.partners.id}</div>
        )
    }
}

export default CompanyGraph
